drop table if exists employees;

create table employees (
	employee_id INT PRIMARY KEY,
	date_hired DATE,
	employee_no INTEGER,
	government_no VARCHAR(50),
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	gender VARCHAR(50),
	email VARCHAR(50),
	street VARCHAR(50),
	city VARCHAR(50),
	state_province VARCHAR(50),
	postal_code VARCHAR(50),
	country VARCHAR(50),
	salary_employee TINYINT,
	rate DECIMAL(10,2)
);

